import CancelImg from './image/Cancel.png';
const CancelImage = CancelImg;
function InputLogin({ children = 'Textfield', type = 'text' }) {
    return (
        <div className="input-login-container">
            <input type={type} placeholder={children} className="input-login"></input>
            <button>
                <img src={CancelImage} alt='취소' className='cancel-img'></img>
            </button>
        </div>
    )
}

export default InputLogin;
